import ReactDom from 'react';
import Europe from './Components/Europe';
import './CSS/App.css';
import './CSS/Europe.css';
import './CSS/Country.css'


function App() {
  return (
    <div className="App">
      <Europe/>
    </div>
  );
}
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<Europe/>);
export default App;
